import React from 'react';

class Contact extends React.Component {
    render() {
        return (
            <div>
                <a name="Contact"></a>
                <section class="footer padded brown">
                    <div class="container">
                        <div class="row">
                            <div class="column">
                                <h2 class="header">Contact Me</h2>
                                <p>
                                    <a href="mailto:vivme3@gmail.com">  <i class="fa fa-envelope-o"></i> &nbsp; VivMe3@gmail.com</a><br />
                                    <i class="fa fa-phone"></i> &nbsp; (908)670-8624 <br />
                                    <a href="https://www.linkedin.com/in/vivian-thanh-do/"><i class="fa fa-linkedin-square"></i></a>
                                    <a href="https://github.com/VivMe3"><i class="fa fa-github-square"></i></a>
                                </p>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        )
    }
}

export default Contact;
